    "2016-07-27T22:45:40.965844",nt"name": "narrative-report-may-june-july-august-1946-des-lacs-national-wildlife-refuge-easement-refu",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Des Lacs National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1946.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, raptors, fish, and disease- is
    also covered. The Refuge development and maintenance section discusses physical
    developments and wildfires. Resource management is outlined; topics include grazing
    and haying. The public relations section of the report describes recreational uses,
    Refuge visitors, and fishing. Items of interest, N-R forms, photographs, and newspaper
    articles are attached.",nt"license_title": "License Not Specified",nt"extras":
